// import logo from './logo.svg';
import './App.css';
import React from 'react';
import ExpenseItem from './components/ExpenseItem';

function App() {
  return (
    <div>
      <ExpenseItem date="2020-01-01" name="New TV" price="799.49" />
      <ExpenseItem date="2021-01-01" name="Car Insurance" price="294.67" />
      <ExpenseItem date="2022-01-01" name="New Desk(Wooden)" price="450" />
    </div>
  );
}

export default App;
